import React, { useState, useEffect } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';

const Navbar = ({ 
  isMenuOpen, 
  setIsMenuOpen, 
  isAdmin, 
  onToggleAdmin, 
  showAdminLogin, 
  adminPassword, 
  setAdminPassword, 
  onAdminLogin, 
  onAdminCancel,
  isLoggedIn,
  currentUser,
  onShowProfile,
  onLogout
}) => {
  const navigate = useNavigate();
  const location = useLocation();
  const [scrolled, setScrolled] = useState(false);

  // Handle scroll effect
  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 20);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const navItems = [
    { name: 'Upcoming Matches', href: '/matches', isLink: true },
    { name: 'Testimonials', href: '/testimonials', isLink: true },
    { name: 'Gallery', href: '/gallery', isLink: true },
    { name: 'Payment Gateway', href: '/payment', isLink: true },
  ];

  const handleLogoClick = () => {
    navigate('/');
    setIsMenuOpen(false);
  };

  useEffect(() => {
    // On homepage load, check if we need to scroll to a section
    if (location.pathname === '/') {
      const scrollTo = sessionStorage.getItem('scrollTo');
      if (scrollTo) {
        setTimeout(() => {
          const element = document.querySelector(scrollTo);
          if (element) {
            element.scrollIntoView({ behavior: 'smooth' });
          }
        }, 200);
        sessionStorage.removeItem('scrollTo');
      }
    }
  }, [location.pathname]);

  return (
    <nav className={`fixed top-0 left-0 right-0 z-50 transition-all duration-300 ${
      scrolled 
        ? 'bg-white/90 backdrop-blur-lg shadow-xl py-2' 
        : 'bg-gradient-to-r from-emerald-600 to-teal-600 shadow-md py-3'
    }`}>
      <div className="container mx-auto px-6 lg:px-12">
        <div className="flex items-center justify-between">
          {/* Logo */}
          <div className="flex items-center cursor-pointer group" onClick={handleLogoClick}>
            <img 
              src="/logo.png" 
              alt="Kickora Logo" 
              className="h-12 w-auto object-contain transition-transform group-hover:scale-105" 
            />
            <span className={`ml-3 text-2xl font-bold transition-colors ${
              scrolled ? 'text-gray-900' : 'text-white'
            }`}>
              Kickora
            </span>
          </div>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-8">
            {navItems.map((item) => (
              <Link
                key={item.name}
                to={item.href}
                className={`font-semibold transition-all duration-300 relative group ${
                  scrolled 
                    ? 'text-gray-700 hover:text-emerald-600' 
                    : 'text-white hover:text-emerald-100'
                }`}
                onClick={() => setIsMenuOpen && setIsMenuOpen(false)}
              >
                {item.name}
                <span className={`absolute bottom-0 left-0 w-0 h-0.5 transition-all duration-300 group-hover:w-full ${
                  scrolled ? 'bg-emerald-600' : 'bg-white'
                }`}></span>
              </Link>
            ))}
          </div>

          {/* User Section */}
          <div className="hidden md:flex items-center space-x-4">
            {isLoggedIn ? (
              <div className="flex items-center space-x-4">
                <button
                  onClick={onShowProfile}
                  className={`font-semibold transition-colors duration-300 ${
                    scrolled ? 'text-gray-700 hover:text-emerald-600' : 'text-white hover:text-emerald-100'
                  }`}
                >
                  üëã {currentUser?.full_name || currentUser?.name || 'User'}
                </button>
                <button
                  onClick={onLogout}
                  className={`px-4 py-2 rounded-lg font-semibold transition-all duration-300 ${
                    scrolled 
                      ? 'bg-gray-100 text-gray-700 hover:bg-gray-200' 
                      : 'bg-white/20 text-white hover:bg-white/30'
                  }`}
                >
                  Logout
                </button>
              </div>
            ) : (
              <Link
                to="/login"
                className="btn-premium"
              >
                Login/Register
              </Link>
            )}
            <button
              onClick={onToggleAdmin}
              className={`px-4 py-2 rounded-lg font-semibold transition-all duration-300 border-2 ${
                isAdmin 
                  ? scrolled
                    ? 'bg-emerald-600 text-white border-emerald-600 hover:bg-emerald-700'
                    : 'bg-white text-emerald-600 border-white hover:bg-emerald-50'
                  : scrolled
                    ? 'border-gray-300 text-gray-600 hover:border-emerald-600 hover:text-emerald-600'
                    : 'border-white/50 text-white hover:bg-white/20'
              }`}
              title={isAdmin ? "Exit Admin Mode" : "Enter Admin Mode"}
            >
              {isAdmin ? "üîê Admin" : "Admin"}
            </button>
          </div>

          {/* Mobile Menu Button */}
          <button
            onClick={() => setIsMenuOpen(!isMenuOpen)}
            className={`md:hidden p-2 rounded-lg transition-all duration-300 ${
              scrolled 
                ? 'text-gray-700 hover:bg-gray-100' 
                : 'text-white hover:bg-white/20'
            }`}
          >
            <svg
              className="w-6 h-6"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
            >
              {isMenuOpen ? (
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth={2}
                  d="M6 18L18 6M6 6l12 12"
                />
              ) : (
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth={2}
                  d="M4 6h16M4 12h16M4 18h16"
                />
              )}
            </svg>
          </button>
        </div>

        {/* Mobile Menu */}
        {isMenuOpen && (
          <div className={`md:hidden py-6 mt-4 rounded-lg transition-all ${
            scrolled ? 'bg-white/95 shadow-lg' : 'bg-white/10 backdrop-blur-md'
          }`}>
            <div className="flex flex-col space-y-4">
              {navItems.map((item) => (
                <Link
                  key={item.name}
                  to={item.href}
                  className={`text-left font-semibold px-4 py-2 rounded-lg transition-all duration-300 ${
                    scrolled 
                      ? 'text-gray-700 hover:bg-emerald-50 hover:text-emerald-600' 
                      : 'text-white hover:bg-white/20'
                  }`}
                  onClick={() => setIsMenuOpen && setIsMenuOpen(false)}
                >
                  {item.name}
                </Link>
              ))}
              {isLoggedIn ? (
                <div className="space-y-2 border-t border-white/20 pt-4 mt-2">
                  <button
                    onClick={() => {
                      onShowProfile();
                      setIsMenuOpen(false);
                    }}
                    className={`text-left font-semibold px-4 py-2 rounded-lg transition-all duration-300 w-full ${
                      scrolled 
                        ? 'text-gray-700 hover:bg-gray-100' 
                        : 'text-white hover:bg-white/20'
                    }`}
                  >
                    üëã {currentUser?.full_name || currentUser?.name || 'User'}
                  </button>
                  <button
                    onClick={() => {
                      onLogout();
                      setIsMenuOpen(false);
                    }}
                    className={`text-left font-semibold px-4 py-2 rounded-lg transition-all duration-300 w-full ${
                      scrolled 
                        ? 'text-gray-700 hover:bg-gray-100' 
                        : 'text-white hover:bg-white/20'
                    }`}
                  >
                    Logout
                  </button>
                </div>
              ) : (
                <Link
                  to="/login"
                  className="btn-premium mx-4"
                  onClick={() => setIsMenuOpen(false)}
                >
                  Login/Register
                </Link>
              )}
              <button
                onClick={onToggleAdmin}
                className={`mx-4 px-4 py-2 rounded-lg font-semibold transition-all duration-300 border-2 ${
                  isAdmin 
                    ? 'bg-emerald-600 text-white border-emerald-600' 
                    : scrolled
                      ? 'border-gray-300 text-gray-600 hover:border-emerald-600'
                      : 'border-white/50 text-white hover:bg-white/20'
                }`}
                title={isAdmin ? "Exit Admin Mode" : "Enter Admin Mode"}
              >
                {isAdmin ? "üîê Admin Mode" : "Admin"}
              </button>
            </div>
          </div>
        )}
      </div>

      {/* Admin Login Modal */}
      {showAdminLogin && (
        <div className="fixed inset-0 bg-black/70 backdrop-blur-sm flex items-center justify-center z-50 animate-fade-in">
          <div className="glass-card p-10 max-w-md w-full mx-4 animate-slide-up">
            <div className="w-16 h-16 bg-gradient-to-br from-emerald-500 to-teal-500 rounded-2xl flex items-center justify-center mx-auto mb-6">
              <svg className="w-8 h-8 text-white" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 15v2m-6 4h12a2 2 0 002-2v-6a2 2 0 00-2-2H6a2 2 0 00-2 2v6a2 2 0 002 2zm10-10V7a4 4 0 00-8 0v4h8z" />
              </svg>
            </div>
            <h3 className="text-3xl font-bold text-gray-900 mb-2 text-center">
              Admin Access Required
            </h3>
            <p className="text-gray-600 text-center mb-6">Enter your admin credentials to continue</p>
            <div className="space-y-4">
              <div>
                <label className="block text-sm font-semibold text-gray-700 mb-3">
                  Admin Password
                </label>
                <input
                  type="password"
                  value={adminPassword}
                  onChange={(e) => setAdminPassword(e.target.value)}
                  onKeyPress={(e) => e.key === 'Enter' && onAdminLogin()}
                  className="premium-input"
                  placeholder="Enter admin password"
                  autoFocus
                />
              </div>
              <div className="flex space-x-3">
                <button
                  onClick={onAdminLogin}
                  className="flex-1 btn-premium py-3"
                >
                  Login
                </button>
                <button
                  onClick={onAdminCancel}
                  className="flex-1 bg-gray-100 text-gray-700 py-3 px-4 rounded-lg font-semibold hover:bg-gray-200 transition-all duration-300"
                >
                  Cancel
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
